import React from "react";
import MainLayout from "../../components/MainLayout";
import Head from "next/head";
import styled from "styled-components";
import {
  VictoryPie,
  VictoryLabel,
  VictoryLine,
  VictoryChart,
  VictoryBar,
  VictoryTheme,
} from "victory";
import {
  PieChart,
  Pie,
  LineChart,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  Line,
} from "recharts";
import { useDispatch } from "react-redux";
import { setLoading } from "../../store/actionCreator";

const Card = styled.div`
  background: #fff;
  border-radius: 10px;
  box-shadow: 2px 2px 7px rgba(0, 0, 0, 0.25);
  padding: 15px 23px;
`;

export default function Dashboard() {
  const dispatch = useDispatch();
  return (
    <div>
      <Head>
        <title>Dashboard - E-Survey</title>
      </Head>
      <MainLayout>
        <div className="pt-10 px-8">
          <h1 className="font-bold">Dashboard</h1>
          <div className="grid grid-cols-4 gap-7 mt-4">
            <Card className="text-center">
              <h2 className="font-bold text-6xl">120</h2>
              <p>Responder</p>
            </Card>
            <Card className="text-center">
              <h2 className="font-bold text-6xl">100</h2>
              <p>Menjawab</p>
            </Card>
            <Card className="text-center">
              <h2 className="font-bold text-6xl">5</h2>
              <p>Tidak Menjawab</p>
            </Card>
            <Card className="text-center">
              <h2 className="font-bold text-6xl">15</h2>
              <p>Pending</p>
            </Card>
          </div>
          <div className="mt-6 grid grid-cols-2 gap-6">
            <Card>
              <h3 className="font-bold text-base">
                Index Keamanan Keimigrasian
              </h3>
              <PieChart width={730} height={250}>
                <Pie
                  data={[
                    { name: "test", value: 2 },
                    { name: "test", value: 3 },
                    { name: "test", value: 1 },
                    { name: "test", value: 4 },
                  ]}
                  dataKey="value"
                  nameKey="name"
                  cx="50%"
                  cy="50%"
                  label={true}
                  labelLine={false}
                  fill="#8884d8"
                  isAnimationActive={true}
                />
              </PieChart>
            </Card>
            <Card>
              <h3 className="font-bold text-base">
                Index Kepuasan Pelayanan Keimigrasian 5 Tahun Terakhir
              </h3>
              <LineChart
                width={730}
                height={250}
                data={[
                  {
                    name: "2016",
                    index: 2,
                  },
                  {
                    name: "2017",
                    index: 3,
                  },
                  {
                    name: "2018",
                    index: 1,
                  },
                  {
                    name: "2019",
                    index: 2,
                  },
                  {
                    name: "2020",
                    index: 4,
                  },
                ]}
                margin={{ top: 30, left: 0, right: 100, bottom: 5 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="index" stroke="#8884d8" />
              </LineChart>
            </Card>
          </div>
          <div className="mt-6">
            <Card>
              <h3 className="font-bold text-base">
                Kepuasan Kebijakan Direktur Jenderal Imigrasi 5 Tahun Terakhir
              </h3>
              <VictoryChart domainPadding={15}>
                <VictoryBar
                  style={{
                    data: { stroke: "#c43a31", fontSize: 14 },
                    parent: { border: "1px solid #ccc", fontSize: 14 },
                  }}
                  data={[
                    { x: "2016", y: "70%" },
                    { x: "2017", y: "74%" },
                    { x: "2018", y: "75%" },
                    { x: "2019", y: "80%" },
                    { x: "2020", y: "85%" },
                  ]}
                  height={50}
                  animate={true}
                />
              </VictoryChart>
            </Card>
          </div>
        </div>
      </MainLayout>
    </div>
  );
}
